import React from 'react';
import './App.css';

function Menu(props:any) {
  const numbers = props.numbers;
  const listItems = numbers.map((number:number) =>
    <li>{number}</li>
  );
  return (
      <ul>{listItems}</ul>
  );
}

export default Menu;
